import TopRated from "./TopRated"

function App() {
    return (
        <>
            <Routes>
                <Route path="toprated" element={<TopRated/>} />
            </Routes>
        rootElement
        <Header/>
        <MovieSlider/>
        </>
    )
}
export default App;
